def my_func(input1: str):
    if len(input1) < 1 or len(input1) > 100:
        return ""

    def most_frequent_chars(string):
        frequency = {}
        for char in string:
            if char in frequency:
                frequency[char] += 1
            else:
                frequency[char] = 1
        sorted_chars = sorted(frequency.items(), key=lambda item: (-item[1], item[0]))
        return sorted_chars[:2]

    most_frequent = most_frequent_chars(input1)
    return "".join(char for char, _ in most_frequent)
